import React, { Component } from "react";

import Image from "./projectImage";
import Link from "next/link";
import { Projects, ProjectsMobile } from "./projects";

import SwiperCore, { Navigation, Pagination, Scrollbar, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

class MyWork extends Component {
  state = {};
  render() {
    return (
      <div className="bg-gray-500 px-4 py-10 md:py-40 w-full" id="my-work">
        <div className="my-4">
          <div className="md:block hidden mx-10">
            {/* <HorizontalScroll reverseScroll={true} style={{ height: "45vw" }}> */}
            <Swiper
              spaceBetween={0}
              slidesPerView={1.3}
              navigation
              pagination={{ clickable: true }}
              scrollbar={{ draggable: true }}
              onSwiper={(swiper) => console.log(swiper)}
              onSlideChange={() => console.log("slide change")}
            >
              <SwiperSlide>
                <Link
                  href="/projects/[slug]"
                  as={`/projects/${this.props.projectData.slug}`}
                >
                  <div className={this.state.modalArray.imgClassName}>
                    <Image projectData={this.props.projectData} />
                  </div>
                </Link>
              </SwiperSlide>
              <Projects />
            </Swiper>

            {/* </HorizontalScroll> */}
            {/* <Gallery /> */}
          </div>
          <div className="md:hidden block h-full">
            <ProjectsMobile />
          </div>
        </div>
      </div>
    );
  }
}

export default MyWork;
